import React from "react";
import styled from "styled-components";

export default function returnPage() {
  return (
    <ReturnBtn>
      <button>다시하기</button>
    </ReturnBtn>
  );
}

const ReturnBtn = styled.div`
  text-align: center;
  button {
    background-color: #db10ff4b;
    color: white;
    text-shadow: 1px 1px 2px #000;
    font-weight: 900;
    width: 100%;
    border: none;
    padding: 1%;
  }
`;
